function Todo({ todo, handleDelete, handleComplete }) {
  return (
    <div className="square-style">
      <div>
        <h2 className="todo-title">{todo.title}</h2>
        <div>{todo.body}</div>
      </div>
      <div className="button-set">
        <CustomButton
          color="brown"
          onClick={() => props.handleDelete(props.todo.id)}
        >
          delete
        </CustomButton>
        <CustomButton
          color="rgb(93, 39, 0)"
          onClick={() => props.handleComplete(props.todo.id)}
        >
          {todo.isDone ? "취소" : "완료"}
        </CustomButton>
      </div>
    </div>
  );
}
export default Todo;
